metadata.description:
Roaring wildly in the highlands of the Swiss alps, this 330 ft tall waterfall dominates the alpine terrain visually and auditively. Its impressive appearance is created by a water-rich glacial stream, which is fed by the melting snow & ice of the surrounding mountains. This particular moment was conserved at autumnal golden hour and lower light conditions due to a heavy blanket of clouds at the westside of the valley. The blanket broke open for a few moments allowing some sunrays to hit the waterfall in the right angle, which led to this rare and intense rainbow.

50/50 edition;  
Longexposure landscape photography;  
from Dominique Weiss;  
Swiss alps;  
5000x3670px;
